import React from 'react';

const Portfolio = () => (
  <main>
    <div className="container">
      {/* Intro */}
      <h1>Our Portfolio</h1>
      <p style={{ color: '#ccc', marginBottom: '30px' }}>
        Explore how <strong>Millennial GFX</strong> has helped brands turn ideas into elegant digital solutions. 
        From high-growth startups to established enterprises, our work spans industries and technologies.
      </p>

      {/* Project Grid */}
      <h2 style={{ marginBottom: '20px' }}>Recent Projects</h2>
      <div style={{
        display: 'grid',
        gridTemplateColumns: 'repeat(auto-fit, minmax(280px, 1fr))',
        gap: '30px',
        marginBottom: '50px'
      }}>
        {projects.map((project, i) => (
          <div key={i} style={cardStyle}>
            <img
              src={project.image}
              alt={project.title}
              style={{ width: '100%', borderRadius: '10px', marginBottom: '12px' }}
            />
            <h3 style={{ color: '#ffd700' }}>{project.title}</h3>
            <p style={{ color: '#ccc' }}>{project.description}</p>
          </div>
        ))}
      </div>

      {/* Industries */}
      <h2 style={{ marginBottom: '16px' }}>Industries We’ve Worked With</h2>
      <ul style={{ display: 'grid', gridTemplateColumns: 'repeat(auto-fit, minmax(200px, 1fr))', gap: '10px', color: '#bbb', marginBottom: '40px' }}>
        <li>📱 Tech Startups</li>
        <li>🛒 E-commerce</li>
        <li>🏥 Healthcare</li>
        <li>🏦 Fintech</li>
        <li>🎓 EdTech</li>
        <li>🏢 Enterprise SaaS</li>
      </ul>

      {/* CTA */}
      <h2 style={{ fontSize: '1.5rem', marginBottom: '12px' }}>Have a project in mind?</h2>
      <p style={{ marginBottom: '20px', color: '#ccc' }}>
        Let’s create something exceptional together. Talk to us about your idea, and we’ll make it real.
      </p>
      <a
        href="/contact"
        style={{
          display: 'inline-block',
          backgroundColor: '#ffd700',
          color: '#0a0a36',
          padding: '12px 20px',
          borderRadius: '6px',
          fontWeight: 'bold',
          textDecoration: 'none'
        }}
      >
        Start Your Project →
      </a>
    </div>
  </main>
);

// ✅ Sample Project Data
const projects = [
  {
    title: 'LuxeCo Cosmetics',
    description: 'E-commerce branding, packaging, and Shopify storefront for a luxury cosmetic startup.',
    image: '/assets/158494648_930174064188188_2880076722509138344_n.jpg',
  },
  {
    title: 'GreenEarth Organics',
    description: 'Minimalist packaging + mobile site design for an eco-conscious brand.',
    image: '/assets/158473746_521319725516803_318154291288381614_n.jpg',
  },
  {
    title: 'Finlite Web App',
    description: 'A modern UI/UX and backend system for a fintech investment platform.',
    image: '/assets/161912871_780577719217607_3448374822930755555_n.jpg',
  },
  {
    title: 'MotionX',
    description: 'Creative animations and landing page for a media & production house.',
    image: '/assets/161807943_199322444862593_2851604551565643586_n.jpg',
  }
];

const cardStyle = {
  backgroundColor: '#111141',
  borderRadius: '12px',
  padding: '20px',
  boxShadow: '0 4px 16px rgba(0, 0, 0, 0.3)',
};

export default Portfolio;
